import {CRAFT_SLIDER, COMP_SLIDER, WINE_CHECK, BEER_CHECK, SPIRIT_CHECK} from './types';

export const craftSlide = (value) => dispatch =>{
    dispatch({    
            type:'CRAFT_SLIDER',
            payload: value
        }
    )
}
export const compSlide = (value) => dispatch => {
    dispatch({
        type: 'COMP_SLIDER',
        payload: value
    });
}
